function Todo (){
    
    const [update, setUpdate] = useState('')

    return (
        <div>
        <input
          className="todo-input"
          value={update}
          onChange={(e) => setUpdate(e.target.value)}
        />
        <button className="todo-button" onClick={handleSubmit}>
          Update
        </button>
        <ul>
            <li></li>
        </ul>
      </div>
    )
}
